import React from 'react';
import { Nav } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

const GeneralInfoSidebar = () => {
  return (
    <div>
      <Nav className="flex-column">
        <Nav.Link as={NavLink} to="#" active>Información general</Nav.Link>
        <Nav.Link as={NavLink} to="#">Inicio</Nav.Link>
        <Nav.Link as={NavLink} to="#">La Asociación</Nav.Link>
        <Nav.Link as={NavLink} to="#">Redes Sociales</Nav.Link>
        <Nav.Link as={NavLink} to="#">Nuestro albergue</Nav.Link>
        <Nav.Link as={NavLink} to="#">Profesionales colaboradores</Nav.Link>
        <Nav.Link as={NavLink} to="#">Contacto</Nav.Link>
        <Nav.Link as={NavLink} to="#">Calendario de google</Nav.Link>
      </Nav>
    </div>
  );
};

export default GeneralInfoSidebar;
